use multiversx_sc_scenario::imports::{Address, ReturnCode};
use multiversx_sc_snippets_base::network_response;
use multiversx_sc_snippets_base::sdk::data::transaction::{TransactionInfo, TransactionOnNetwork};
use multiversx_sdk::bech32;

#[test]
fn test_deployed_address() {
    let data = r#"
        {
  "data": {
    "transaction": {
      "type": "normal",
      "processingTypeOnSource": "SCDeployment",
      "processingTypeOnDestination": "SCDeployment",
      "hash": "07a176d1734d1901d396be344f97e1d80f076269e9559f9b2110f6f11c4f74de",
      "nonce": 427,
      "round": 2190715,
      "epoch": 887,
      "value": "0",
      "receiver": "erd1qqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqqq6gq4hu",
      "sender": "erd1j6kua7p67qnaw3y4sudmk25xsuv4k8ws6pwvax8fd2vtmuc3q33s840l87",
      "gasPrice": 1000000000,
      "gasLimit": 600000000,
      "data": "",
      "signature": "edf0ec99b6f60414fa5e36d40cfb1d0075d01fd7c4ad7ba59bbe62b8b48eb892beb0c18bba203ff32b83827c3953847b190cdc89a4806f4615565dc2b3b5940f",
      "sourceShard": 1,
      "destinationShard": 1,
      "blockNonce": 2127577,
      "blockHash": "e3aea17b5345b45f61b233834d3b4ba0ac6f2b7d53eb3f1b1cf2bf0534ba567f",
      "notarizedAtSourceInMetaNonce": 2129029,
      "NotarizedAtSourceInMetaHash": "73ee8458f55bf5c9ea4a9974c0c838ced51a236c2b13238761f444598f40575e",
      "notarizedAtDestinationInMetaNonce": 2129029,
      "notarizedAtDestinationInMetaHash": "73ee8458f55bf5c9ea4a9974c0c838ced51a236c2b13238761f444598f40575e",
      "miniblockType": "TxBlock",
      "miniblockHash": "cc7e81e68269c2c633daf997fd2d52fc82d8ba3bb699d7e75250008bd9b7aa29",
      "hyperblockNonce": 2129029,
      "hyperblockHash": "73ee8458f55bf5c9ea4a9974c0c838ced51a236c2b13238761f444598f40575e",
      "timestamp": 1707144290,
      "status": "success",
      "operation": "scDeploy",
      "initiallyPaidFee": "82333950000000000",
      "chainID": "D",
      "version": 1,
      "options": 0
    }
  },
  "error": "",
  "code": "successful"
}
        "#;

    let tx_on_network: TransactionOnNetwork = serde_json::from_str::<TransactionInfo>(data)
        .unwrap()
        .data
        .unwrap()
        .transaction;
    let tx_response = network_response::parse_tx_response(tx_on_network, ReturnCode::Success);
    let opt_address = tx_response
        .new_deployed_address
        .map(|address| bech32::encode(&address));

    let expected =
        Some("erd1qqqqqqqqqqqqqpgqwpdf84ggxzqzmr2zmw959q4nlf9nz562q33sak25ze".to_string());

    assert_eq!(opt_address, expected)
}

